<# 
.SYNOPSIS 
Toggle-WifiEth.ps1 The script either enables WiFi or Ethernet adapter.
 
.DESCRIPTION
The script extracts all the network adapters available and filters only physical adapter.
Once the physical adapter are found, it does the following:
    > checks if all adapters are enabled.
    > if WiFi and Ethernet adapter are both enabled, then disables WiFi (since ethernet is preferred).
    > To prefer network adapters, then use the parameter -Preference

AuthorName      Thanuj M
CreatedDate     11:00 PM 5/28/2017	
ModifiedDate    11:44 AM 5/29/2017
Developer       Thanuj M
VersionNumber   1.0.1.0
VersionHistory	
    1.0.0.0
                Skeleton (basic) script created
                11:15 PM 5/28/2017
    1.0.1.0
                Help message included
                Included adminsitrator privilege  check
                11:44 AM 5/29/2017

ScriptUsage     .\Toggle-WifiEth.ps1

.PARAMETER Preference
This parameter is not mandatory and default value is set to "Toggle"

.EXAMPLE  
.\Toggle-WifiEth.ps1
OR
.\Toggle-WifiEth.ps1 -Preference Toggle

Either of the above method does the same job of Toggling between Wireless and Ethernet adapater

.EXAMPLE  
.\Toggle-WifiEth.ps1 -Preference Ethernet

If you set the -Preference switch to ethernet then Ethernet adapter will be enabled

.EXAMPLE  
.\Toggle-WifiEth.ps1 -Preference Wireless

If you set the -Preference switch to Wireless then Wireless adapter will be enabled
#>
[CmdletBinding()]

param([ValidateSet('Ethernet','Wireless','Toggle')]$Preference="Toggle")

function ToggleAdapter
{
    param($Wifi=@(),$Ether=@(),[ValidateSet('Ethernet','Wireless','Toggle','All')]$Pref="Toggle")

    try
    {
        [bool]$IsWifiEnabled = $false
        [bool]$IsEtherEnabled = $false
        [bool]$IsWifiNetEnabled = $false
        [bool]$IsEtherNetEnabled = $false

        [Array]$AllIFaces = Get-WmiObject -Class Win32_NetworkAdapter -Filter "Manufacturer != 'Microsoft' AND NOT PNPDeviceID LIKE 'ROOT\\%'"
        [Array]$Wifis = @()
        [Array]$Ethers = @()

        if($Pref -ine 'All'){
            if($Wifi.Count -ge 1){$Wifis = $AllIFaces | Where-Object { $Wifi -icontains $_.NetConnectionID } }
            else{$Wifis = $AllIFaces | Where-Object { $Ether -inotcontains $_.NetConnectionID }}
            
            if($Ether.Count -ge 1){ $Ethers = $AllIFaces | Where-Object { $Ether -icontains $_.NetConnectionID } }
            else{ $Ethers = $AllIFaces | Where-Object { $Wifi -inotcontains $_.NetConnectionID } }

            $Wifis | Select-Object Description,ServiceName, @{Label="AdapterEnabled";Expression={$(if((Get-Service $_.ServiceName).Status -eq "Running"){$true}else{$false}) }} | % {$IsWifiEnabled = ($IsWifiEnabled -or $_.AdapterEnabled) }
            $Ethers | Select-Object Description,ServiceName, @{Label="AdapterEnabled";Expression={$(if((Get-Service $_.ServiceName).Status -eq "Running"){$true}else{$false}) }} | % {$IsEtherEnabled = ($IsEtherEnabled -or $_.AdapterEnabled) }

            $Wifis | % {$IsWifiNetEnabled = ($IsWifiNetEnabled -or [bool]$_.NetEnabled) }
            $Ethers | % {$IsEtherNetEnabled = ($IsEtherNetEnabled -or [bool]$_.NetEnabled) }
        }

        switch($Pref){
            'Ethernet'{
                if($IsWifiEnabled){$Wifis | % { [void]$_.Disable() } ; Write-Output "Ethernet Enabled and Wireless Disabled"  }
                if(-not $IsEtherEnabled){$Ethers | % { [void]$_.Enable() } }
            }
            'Wireless'{
                if($IsEtherEnabled){$Ethers | % { [void]$_.Disable() } ; Write-Output "Wireless Enabled and Ethernet Disabled" }
                if(-not $IsWifiEnabled){$Wifis | % { [void]$_.Enable() } }         
            }
            'Toggle'{
                if(($IsEtherEnabled -eq $true) -and ($IsWifiEnabled -eq $true)){
                    $Wifis | % { [void]$_.Disable() }
                    Write-Output "Wireless/Ethernet both were in enabled state, so disabled Wireless"
                }elseif(($IsEtherEnabled -eq $false) -and ($IsWifiEnabled -eq $false)){
                    $Ethers | % { [void]$_.Enable() }
                    Write-Output "Wireless/Ethernet both were in disabled state, so enabled Ethernet"
                }else{
                    if($IsEtherEnabled -eq $true){
                        $Wifis | % { [void]$_.Enable() }
                        $Ethers | % { [void]$_.Disable() }
                        Write-Output "Toggle - Ethernet Disabled and Wireless Enabled"
                    }else{
                        $Ethers | % { [void]$_.Enable() }
                        $Wifis | % { [void]$_.Disable() }
                        Write-Output "Toggle - Wireless Disabled and Ethernet Enabled"
                    }
                }

            }
            'All'{
                Write-Output "All interfaces are currently in disabled state, enabling all and waiting for to establish network..."
                $AllIFaces | % { [void]$_.Enable() }
                Start-Sleep -Seconds 30
            }
        }
    }
    catch
    {
        Write-Output "Error occured while toggling $($_.exception.message)"
    }
}

$ErrorActionPreference = "Stop"
$MagicKeys = @{Wireless="wireless lan adapter"
                            Ethernet="ethernet adapter"}

try
{
    Write-Host "`n"
    [Array]$PhysicalAdapterIFaces = Get-WmiObject -Class Win32_NetworkAdapter #-Filter "Manufacturer != 'Microsoft' AND NOT PNPDeviceID LIKE 'ROOT\\%'"
    [Array]$NetworkEnabledIFaces = @()
    [Array]$AdapterIFacesStatus = @()
    [Array]$WirelessIfaces = @()
    [Array]$EthernetIfaces = @()
    [bool]$IsAllEnabled = $false

    if($PhysicalAdapterIFaces.Count -le 0){Write-Output "No physical adapter(s) found, exiting!`n" ; exit }
    elseif($PhysicalAdapterIFaces.Count -eq 1){Write-Output "1 physical adapter found and toggling is not applicable, exiting!`n"; exit}
    else{
    $AdapterIFacesStatus = $PhysicalAdapterIFaces | Select-Object Description,ServiceName, @{Label="AdapterEnabled";Expression={$(if((Get-Service $_.ServiceName).Status -eq "Running"){$true}else{$false}) }}

    $AdapterIFacesStatus | % { $IsAllEnabled = ($IsAllEnabled -or $_.AdapterEnabled) }

    [Array]$NetworkEnabledIFaces = $PhysicalAdapterIFaces | Where-Object { $_.NetEnabled -eq $true}

    $usercontext = [Security.Principal.WindowsPrincipal][Security.Principal.WindowsIdentity]::GetCurrent()
    $IsAdmin = $usercontext.IsInRole([Security.Principal.WindowsBuiltInRole] "Administrator") 

    #if(-not $IsAdmin){ Write-Output "Your account {$($usercontext.Identities[0].Name)} is not part of an administrator group nor your account is in a group with admin privilleges to proceed further. Exiting...`n" ; exit}

    if(-not $IsAllEnabled)
    {
        ToggleAdapter -Pref All
    }

    [Array]$ipconfig = ipconfig
    [Array]$ipconfig_adapters = $ipconfig | Select-String "adapter"

    $Adapters = @{}

    foreach($Iface_name in $MagicKeys.Keys)
    {
        try{
        $Adapters.Add($Iface_name, @())
        [string]$magicKey = "{0} " -f $MagicKeys[$Iface_name]
        foreach($PIface in $PhysicalAdapterIFaces)
        {
            try{
            $connectionID = [string]($PIface.NetConnectionID).ToLower()
            foreach($ipconfigadapter in $ipconfig_adapters)
            {
                try{
                [string]$tmp_data = $ipconfigadapter
                $tmp_data = ($tmp_data.Substring($magicKey.Length, $tmp_data.Length - $magicKey.Length)).ToLower()
                $tmp_id = [string]("{0}{1}" -f $connectionID, ":")
                if($tmp_data -eq $tmp_id){$Adapters[$Iface_name] += $connectionID}
                }
                catch{}
            }
            }
            catch{}
        }
        }
        catch{}
    }

    $WirelessIfaces = $Adapters.Wireless
    $EthernetIfaces = $Adapters.Ethernet
    [String]$tmp_wifi = ""
    [String]$tmp_eth = ""

    if($WirelessIfaces.Count -ge 1){$tmp_wifi = $($tmp = "" ; $Adapters.Wireless | % { $tmp += "$_," } ; $tmp) ; $tmp_wifi = $tmp_wifi.Substring(0, $tmp_wifi.Length-1)}
    if($EthernetIfaces.Count -ge 1){$tmp_eth = $($tmp = "" ; $Adapters.Ethernet | % { $tmp += "$_," } ; $tmp) ; $tmp_eth = $tmp_eth.Substring(0, $tmp_eth.Length-1)}

    Write-Output $("There are total {0} physical adapter(s) found and {1} adapter(s) are currently network enabled:`n `n{2} Wireless Adapter(s) found ({3})`n{4} Ethernet Adapter(s) found ({5})" -f $PhysicalAdapterIFaces.Count, $NetworkEnabledIFaces.Count, $WirelessIfaces.Count, $tmp_wifi, $EthernetIfaces.Count, $tmp_eth)

    if($WirelessIfaces.Count -le 0 -or $EthernetIfaces.Count -le 0){Write-Output "Toggling function is applicable only if there are atleast 1 adapter found in each Wireless/Ethernet network type. Exiting...`n" ; exit }
    ToggleAdapter -Wifi $WirelessIfaces -Ether $EthernetIfaces -Pref $Preference
    }
}
catch
{
    Write-Output "Error occured while processing the script. $($_.exception.message)`n"
}


